import Layout from "../components/Layout"

export default function HomePage(){
  return (
    <Layout style={{ textAlign: 'center'}}>
      <br/>
      <h3>Bread - free games for your server</h3>

      <br/>
      <button>Learn More</button>
      <button>Invite</button>
    </Layout>
  )
}
